const e=JSON.parse('{"key":"v-f975e8c4","path":"/reading/algorithm/offer_oriented/AL_DS/05_hashtable/05.3.html","title":"5.3 哈希表应用","lang":"zh-CN","frontmatter":{"title":"5.3 哈希表应用","date":"2023-09-11T00:00:00.000Z","category":["algorithm"]},"headers":[{"level":2,"title":"5.3.1 问题32: 有效的变位词","slug":"_5-3-1-问题32-有效的变位词","link":"#_5-3-1-问题32-有效的变位词","children":[{"level":3,"title":"5.3.1.1 分析","slug":"_5-3-1-1-分析","link":"#_5-3-1-1-分析","children":[]},{"level":3,"title":"5.3.1.2 题解","slug":"_5-3-1-2-题解","link":"#_5-3-1-2-题解","children":[]}]},{"level":2,"title":"5.3.2 问题33: 变位词分组","slug":"_5-3-2-问题33-变位词分组","link":"#_5-3-2-问题33-变位词分组","children":[{"level":3,"title":"5.3.2.1 分析&题解","slug":"_5-3-2-1-分析-题解","link":"#_5-3-2-1-分析-题解","children":[]}]},{"level":2,"title":"5.3.3 问题34: 外星语言是否排序","slug":"_5-3-3-问题34-外星语言是否排序","link":"#_5-3-3-问题34-外星语言是否排序","children":[{"level":3,"title":"5.3.3.1 分析&题解","slug":"_5-3-3-1-分析-题解","link":"#_5-3-3-1-分析-题解","children":[]}]},{"level":2,"title":"5.3.4  问题35: 最小时间差","slug":"_5-3-4-问题35-最小时间差","link":"#_5-3-4-问题35-最小时间差","children":[{"level":3,"title":"5.3.4.1 分析","slug":"_5-3-4-1-分析","link":"#_5-3-4-1-分析","children":[]},{"level":3,"title":"5.3.4.2 题解","slug":"_5-3-4-2-题解","link":"#_5-3-4-2-题解","children":[]}]},{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"git":{"updatedTime":1694451412000},"readingTime":{"minutes":6.31,"words":1893},"filePathRelative":"reading/algorithm/offer_oriented/AL_DS/05_hashtable/05.3.md","localizedDate":"2023年9月11日","excerpt":"<p>若哈希表的Key取值范围固定, 且范围不大, 那么可以使用数组来模拟哈希表.</p>\\n<h2> 5.3.1 问题32: 有效的变位词</h2>\\n<blockquote>\\n<p>给定两个字符串 <code>s</code> 和 <code>t</code> ，编写一个函数来判断它们是不是一组变位词（字母异位词）。</p>\\n<p><strong>注意：<strong>若 <code>*s*</code> 和 <code>*t*</code> 中每个字符出现的次数都相同且</strong>字符顺序不完全相同</strong>，则称 <code>*s*</code> 和 <code>*t*</code> 互为变位词（字母异位词）。</p>\\n<p><strong>示例 1:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入: s = \\"anagram\\", t = \\"nagaram\\"\\n输出: true\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>示例 2:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入: s = \\"rat\\", t = \\"car\\"\\n输出: false\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>示例 3:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入: s = \\"a\\", t = \\"a\\"\\n输出: false\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>提示:</strong></p>\\n<ul>\\n<li><code>1 &lt;= s.length, t.length &lt;= 5 * 104</code></li>\\n<li><code>s</code> and <code>t</code> 仅包含小写字母</li>\\n</ul>\\n<p><strong>进阶:</strong> 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？</p>\\n</blockquote>"}');export{e as data};
